    super(props);
    this.state ={
      calcDisplay: 0,
      numInMem: 0

    }
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>THE CALCULATOR</h1>
        </header>
      </div>
    );
  }
}

export default App;
